<script>
  function openNav() {
    document.getElementById("sidebar").style.left = 0;
    document.getElementById("main").style.marginLeft = "380px";
    document.getElementById("sidebar-button").onclick = closeNav;
    var interval = setInterval(function () { window.dispatchEvent(new Event('resize')); }, 10);
    setTimeout(function () { clearInterval(interval) }, 210)
  }

  function closeNav() {
    document.getElementById("sidebar").style.left = "-380px";
    document.getElementById("main").style.marginLeft = 0;
    document.getElementById("sidebar-button").onclick = openNav;
    var interval = setInterval(function () { window.dispatchEvent(new Event('resize')); }, 10);
    setTimeout(function () { clearInterval(interval) }, 210)
  }

  var modal = document.getElementById("pn-Modal");
  var span = document.getElementById("pn-closeModal");

  span.onclick = function() {
    modal.style.display = "none";
  }

  window.onclick = function(event) {
    if (event.target == modal) {
      modal.style.display = "none";
    }
  }
</script>

<script type="text/babel">
 const divStyle = {borderRadius: '5px'};

 const ResponsiveGridLayout = ReactGridLayout.WidthProvider(ReactGridLayout.Responsive);
 const originalLayout = getFromLS("layouts") || {'lg': [{'x': 0, 'y': 0, 'w': 12, 'h': 1, 'i': '1', 'minW': 0, 'maxW': 'Infinity', 'minH': 0, 'maxH': 'Infinity'}], 'md': [{'x': 0, 'y': 0, 'w': 12, 'h': 1, 'i': '1', 'minW': 0, 'maxW': 'Infinity', 'minH': 0, 'maxH': 'Infinity'}]};

 function resize_layout(obj, old_, new_, p, e, element) {
     window.dispatchEvent(new Event("resize"))
 }

 function resize_layout_stop(obj, old_, new_, p, e, element) {
     setTimeout(function(){
         window.dispatchEvent(new Event("resize"))
     }, 50);
 }

 function getFromLS(key) {
     let ls = {};
     if (window.localStorage) {
         try {
             ls = JSON.parse(window.localStorage.getItem(window.location.href)) || {};
         } catch (e) {
             /*Ignore*/
         }
     }
     return ls[key];
 }

 function saveToLS(key, value) {
     if (window.localStorage) {

         window.localStorage.setItem(
             window.location.href,
             JSON.stringify({
                 [key]: value
             })
         );
     }
 }

 class ResponsiveGrid extends React.PureComponent
 {
     static defaultProps = {
         onLayoutChange: function() {}
     }

     constructor(props)
     {
         super(props);
         this.state = {
             layouts: JSON.parse(JSON.stringify(originalLayout))
         };

         
     }

    resetLayout() {
         this.setState({
             layouts: {'lg': [{'x': 0, 'y': 0, 'w': 12, 'h': 1, 'i': '1', 'minW': 0, 'maxW': 'Infinity', 'minH': 0, 'maxH': 'Infinity'}], 'md': [{'x': 0, 'y': 0, 'w': 12, 'h': 1, 'i': '1', 'minW': 0, 'maxW': 'Infinity', 'minH': 0, 'maxH': 'Infinity'}]}
         });
     }

     onLayoutChange(layout, layouts)
     {
         saveToLS("layouts", layouts);
         this.setState({ layouts });
     }

     render()
     {
      return (
             <ResponsiveGridLayout
		         className={"layout"}
                 cols={ {'lg': 12, 'md': 10, 'sm': 6, 'xs': 4, 'xxs': 2} }
                 breakpoints={ {'lg': 1200, 'md': 996, 'sm': 768, 'xs': 480, 'xxs': 0} }
                 draggableHandle={".drag-handle"}
                 onResize={resize_layout}
                 onResizeStop={resize_layout_stop}
		         draggableCancel={".bk-root"}
                 rowHeight={ 150 }
                 layouts={this.state.layouts}
                 
                 verticalCompact={false}
                 
                 preventCollision={ false }
                 
             >
                 
                 
                 <div key="1" style={divStyle} >
			         <span className="drag-handle"></span>
                     <div className="bk-root" id="3d87995d-c8a3-4cd3-9019-35f0eb1d27ff" data-root-id="1309"></div>
                 </div>
                 
                 
             </ResponsiveGridLayout>
         );
     }
 }
 ReactDOM.render(<ResponsiveGrid />, document.getElementById('responsive-grid'))


</script>
